import React from 'react';

const CertificadoCompleto = ({ receta, paciente }) => {
  const fecha = new Date(receta.fecha).toLocaleDateString();

  const handlePrint = () => {
    const printContents = document.getElementById(`certificado-${receta._id}`).innerHTML;
    const printWindow = window.open('', '', 'width=800,height=600');
    printWindow.document.write(`
      <html>
        <head>
          <title>Imprimir Receta</title>
          <style>
            body { font-family: Arial, sans-serif; padding: 20px; color: black; }
            h2, h3, h4 { text-align: center; margin: 0; }
            .watermark {
              position: fixed;
              top: 50%;
              left: 50%;
              transform: translate(-50%, -50%);
              font-size: 80px;
              color: rgba(0, 0, 0, 0.05);
              pointer-events: none;
              z-index: -1;
            }
          </style>
        </head>
        <body>
          <div class="watermark">ORTODONCIA RHELMÜ</div>
          ${printContents}
        </body>
      </html>
    `);
    printWindow.document.close();
    printWindow.focus();
    printWindow.print();
    printWindow.close();
  };

  return (
    <div className="p-4">
      <button
        onClick={handlePrint}
        className="bg-green-600 text-white px-4 py-2 rounded hover:bg-green-700 mb-4"
      >
        Imprimir este certificado
      </button>

      <div
        id={`certificado-${receta._id}`}
        className="bg-white p-10 max-w-[800px] mx-auto border text-black font-sans shadow relative"
      >
        <div className="text-center mb-6">
          <img src="/logo-rhelmu.png" alt="Logo" className="h-16 mx-auto" />
          <h2 className="text-xl font-semibold">Dr. Mauricio Hurtado Cáceres</h2>
          <p className="text-blue-600 font-semibold">Ortodoncia y Ortopedia</p>
          <p className="text-blue-500">Dentomaxilofacial</p>
          <p className="text-sm mt-1">Rut: 12.917.335-1</p>
        </div>

        <h3 className="text-center text-lg font-bold underline mb-6">CERTIFICADO Y RECETA MÉDICA</h3>

        <div className="mb-6 space-y-1 text-sm">
          <p><strong>Nombre del Paciente:</strong> {paciente.nombre}</p>
          <p><strong>RUT:</strong> {paciente.rut}</p>
          <p><strong>Fecha:</strong> {fecha}</p>
          <p><strong>Vigencia:</strong> {receta.vigencia} días</p>
        </div>

        <hr className="my-4" />

        <h4 className="font-semibold mb-2 text-sm">Medicamentos Recetados:</h4>
        <ul className="list-disc ml-6 text-sm">
          {receta.medicamentos.map((med, idx) => (
            <li key={idx}>
              <strong>{med.nombre}</strong> - {med.dosis}, {med.frecuencia} por {med.duracion}
            </li>
          ))}
        </ul>

        {receta.indicaciones && (
          <>
            <h4 className="font-semibold mt-4 text-sm">Indicaciones adicionales:</h4>
            <p className="text-sm">{receta.indicaciones}</p>
          </>
        )}

        <div className="text-center mt-12">
          <p className="border-t border-black inline-block px-4 pt-2 font-semibold">Dr. Mauricio Hurtado Cáceres</p>
          <p className="text-sm">12.917.335-1</p>
        </div>

        <div className="text-sm text-center mt-6">
          Dirección: Lord Cochrane 635, Torre B, piso 10, Oficina 1002, Concepción.<br />
          Teléfono: +56 944435569
        </div>
      </div>
    </div>
  );
};

export default CertificadoCompleto;
